import React from "react";
import "./StorePage.css";
import backsplash from "client/src/assets/backsplash_placeholder.png";

function StorePage() {
  return (
    <div id="store-page">
      <div>
        <img src={backsplash} id="backsplash"></img>
      </div>
    </div>
  );
}

export default StorePage;
